                    <li>помощь в процедуре ликвидации и реорганизации акционерных обществ;</li>
                </ul>
                <p class=""podzagolovok1"" style=""text-indent:25px;"">Осуществляет подготовку пакета документов      и их сопровождение  в  Государственной комиссии по ценным      бумагам и фондовому рынку ");
                WriteLiteral(@"для:</p>
                <ul class=""tick"">
                    <li><em>регистрации выпусков ценных бумаг и проспектов их эмиссии:</em></li>
                </ul>
                <ul>
                    <li><em>акций</em> – при создании акционерного общества;</li>
                    <li><em>акций</em> – при увеличении/уменьшении размера уставного капитала;</li>
                    <li><em>акций</em> – при деноминации акций, индексации основных фондов;</li>
                    <li><em>акций</em> – при реорганизации хозяйственных обществ;</li>
                    <li><em>замена свидетельства о регистрации выпуска акций</em> – при замене формы существования акций (с документарной на бездокументарную);</li>
                    <li><em>облигаций</em> предприятий (процентных, дисконтных, целевых), местных займов; <em>опционных сертификатов;</em></li>
                    <li><em>акций</em> корпоративных инвестиционных фондов;</li>
                    <li><em>инвестиционных сертификатов</em> паевых инвес");
                WriteLiteral(@"тиционных фондов;</li>
                </ul>
                <ul class=""tick"">
