                    <li><em>регистрации регламентов институтов совместного инвестирования (корпоративных и паевых инвестиционных фондов);</em></li>
                    <li><em>получения лицензий на осуществление профессиональной деятельности на фондовом рынке : </em></li>
                </ul>
                <ul>
                    <li>деятельности по торговле  ценными бумагами;</li>
