                    <li>деятельности по управлению активами институционных  инвесторов.</li>
                </ul>
                <p class=""podzagolovok1"" style=""text-indent:25px;"">Предоставляет консультационные услуги по всем вопросам деятельности на фондовом рынке.</p>");
